import React from 'react';
import styles from './award_section.module.css'
import styles_d from '../detail_section/detail_section.module.css';
import classnames from 'classnames';
const AwardSection = (props) => {

    return (
        <div className={styles.award_section}>
            <p className={classnames(styles.detail_section_p, styles.detail_section_p_google)}> 700만 명의 여행자</p>
            <p className={styles.award_section_p}>
                2018 구글 플레이스토어
                올해의 앱 최우수상 수상</p>
            <p className={styles.award_section_p}>
                2018 애플 앱스토어
                오늘의 여행앱 선정</p>
        </div>);
}


export default AwardSection;
